import React from 'react'
import { useTheme } from '@mui/material/styles';
import { Grid, Container, Typography } from '@mui/material';
import Dashboard from '../../app/Appdashboard'
import Page from '../pures/Page';

export default function ShowData() {
    const theme = useTheme();

    return (

        <Page title='Dashboard'>
        <Container>

            <Grid item xs={12} md={6} lg={8}>
                <Dashboard
                    title="Tension panel"
                    subheader="(+43%) than last year"
                    chartLabels={[
                        '01/01/2003',
                        '02/01/2003',
                        '03/01/2003',
                        '04/01/2003',
                        '05/01/2003',
                        '06/01/2003',
                        '07/01/2003',
                        '08/01/2003',
                        '09/01/2003',
                        '10/01/2003',
                        '11/01/2003',
                    ]}
                    chartData={[
                        {
                            name: 'Team A',
                            type: 'column',
                            fill: 'solid',
                            data: [23, 11, 22, 27, 13, 22, 37, 21, 44, 22, 30],
                        },
                        {
                            name: 'Team B',
                            type: 'area',
                            fill: 'gradient',
                            data: [44, 55, 41, 67, 22, 43, 21, 41, 56, 27, 43],
                        },
                        {
                            name: 'Team C',
                            type: 'line',
                            fill: 'solid',
                            data: [30, 25, 36, 30, 45, 35, 64, 52, 59, 36, 39],
                        },
                        {
                            name: 'Team D',
                            type: 'line',
                            fill: 'solid',
                            data: [30, 25, 36, 30, 45, 35, 64, 52, 59, 36, 39],
                        },
                        {
                            name: 'Team E',
                            type: 'line',
                            fill: 'solid',
                            data: [30, 25, 36, 30, 45, 35, 64, 52, 59, 36, 39],
                        },
                        {
                            name: 'Team F',
                            type: 'line',
                            fill: 'solid',
                            data: [30, 25, 36, 334, 45, 35, 64, 52, 59, 36, 39],
                        }
                    ]}
                />
            </Grid>
        </Container>
        </Page>

    )
}
